import logo from './logo.svg';
import './App.css';
import {useState, useEffect} from 'react';
import useColumns from "./useColumns";
import { useTable } from "react-table"

import useFetch from './hooks/useFetch.js';

function App() {
  let urls = ['https://jsonplaceholder.typicode.com/todos/1',
              'https://jsonplaceholder.typicode.com/todos/2']

  const { data1, data2 } = useFetch()

  const columns = useColumns();

  const dataList = [data1];
  const {
    getTableProps,
    getTableBodyProps,
    headerGroups,
    rows,
    prepareRow
  } = useTable({ columns, dataList});



  //console.log(jsonData[0])

  //const [data, isLoading, isError] = useFetch(['https://jsonplaceholder.typicode.com/todos/1'])

  //console.log("HEREEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEE")


  //const url = query && 'https://api.preqin.com/api/Investor?FirmId=' + query;

  //const { myStatus, myData } = useFetch(query && 'https://api.preqin.com/api/Investor?FirmId=' + query);
  //const { myStatus, myData } = useFetch('https://api.preqin.com/api/Investor?FirmId=' + query);

  //const { myStatus, myData } = useFetch('https://api.preqin.com/api/Investor?FirmId=' + query);

  //const { myStatus, myData } = useFetch();

  //const [data2, isLoading2, isError2] = useFetch(myurl)



  //console.log("data is..")
  //console.log(jsonData1)
  /*
  return (

    <div className="App">
      <p>"Hello World"</p>
    </div>

    <pre>{JSON.stringify(data1, null, 2)}</pre>

  );
  */

  return (
    <div className="container">
      <table {...getTableProps()}>
        <thead>
          {headerGroups.map(headerGroup => (
            <tr {...headerGroup.getHeaderGroupProps()}>
              {headerGroup.headers.map(column => (
            <th {...column.getHeaderProps()}>{column.render("Header")}</th>
          ))}
            </tr>
          ))}
        </thead>
        <tbody {...getTableBodyProps()}>
          {rows.map(row => {
            prepareRow(row);

            return (
              <tr {...row.getRowProps()}>
                {row.cells.map(cell => {
                  return (
                    <td {...cell.getCellProps()}>{cell.render("Cell")}</td>
                  );
                })}
              </tr>
            );
          })}
        </tbody>
      </table>
    </div>
  );

}

export default App;
